水が飛び出る！ボディスポンジ　デイジーダック<br><br>泡立てラクチン！なメッシュスポンジ。キュートなデイジーのフィギュア付き。<br>フィギュアを水の中に入れて押すと、リボンから水が飛び出るよ！<br><br>ディズニーの人気キャラクターのフィギュアが付いたネットタイプのボディスポンジ。<br>フィギュアを湯船や水に沈めると水鉄砲のようになり遊ぶ事もできます。<br>ディズニーキャラクターといっしょに楽しいバスタイムを演出します。<br><br>&yen;525円（本体価格 &yen;500）<br>JAN：4971825011471<br>デイジーダック×1<br>個箱：140×60×200mm 38g<br><br>ブランド： ディズニー<br>商品の高さ： 200mm<br>商品の幅： 140mm<br><br>商品の使い方<br>●はじめにネット部分を濡らし、ボディソープや石けんを付けてよく泡立ててから体洗いにご使用ください。<br>●水を飛び出させるには、人形部分を水の中に沈めて数回押すと中に水が入ります。水から出して人形を押すと人形の頭に付いているリボンの穴から水が飛び出します。<br>※使用後は人形の中の水を出してよく乾かしください。 使用上の注意注意：　水が飛び出す際に、人の顔や目に向けないでください。<br><br>使用上の注意<br>●お子様の誤飲や思わぬ事故を起こす可能性がありますので、商品を分解したり、口に入れたりしないでください。<br>●肌の弱い方、肌に異常のある方、アレルギー体質の方、乳幼児には使用しないでください。<br>●顔には使用しないでください。<br>●肌を傷めないように、こすりすぎないでください。<br>●使用後はよくすすぎ、水気を切り風通しのよい所で乾かしてください。<br>●洗濯機、乾燥機、漂白剤は使用しないでください。<br>●ヒモを強く引っ張らないでください。<br>●スポンジと人形を引き離すように強く引っ張らないでください。<br>●火のそばに置かないでください。<br>●乳幼児の手の届く所に置かないでください。<br>●本来の用途以外に使用しないでください。<br><br><br> JAN：4971825011471<br>販売元：　シービック<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
